use actix_web::{post, App, HttpServer, Responder};
use actix_multipart::form::{tempfile::TempFile, MultipartForm}; #[derive(Debug, MultipartForm)]
struct UploadForm { #[multipart(limit = "100MB")] file: TempFile,
} #[post("/upload")]
pub async fn upload(MultipartForm(mut form): MultipartForm<UploadForm>) -> impl Responder { // 获得文件 Bytes let mut buffer = vec![]; let _ = form.file.file.read_to_end(&mut buffer); format!( "Uploaded file {:?}, with size: {}", form.file.file_name, form.file.size )
} #[actix_web::main]
async fn main() -> std::io::Result<()> { HttpServer::new(move || App::new().service(upload)) .bind(("127.0.0.1", 8080))? .run() .await
}

